  slideIn = {
    hidden: {
      opacity: 0,
      x: "-100%",
    },
    visible: {
      opacity: 1,
      x: 0,
      transition: {
        duration: 5,
        delay: 0.2,
        type: "spring",
        stiffness: 80,
      },
    },
  };
}
export default AppAnimations;

